import React from 'react'
import { connect } from 'react-redux';
import {selectCollection} from '../../redux/shop/shop.selectors'

import CollectionsContainer from '../../components/collection-container/collection-container.component'
import CollectionsOverview from '../../components/collections-overview/collections-overview.component'

const CollectionOverviewPage = ({ collections, shop }) => {
    return (
        <CollectionsContainer title="See What's New">
            <CollectionsOverview collections = {collections}/>
        </CollectionsContainer>
)}

const mapStateToProps = (state, ownProps) => ({
    collections: selectCollection(ownProps.match.params.collectionId)(state),
})

export default connect(mapStateToProps)(CollectionOverviewPage)
